/*
include与require
	引入另一个文件到当前文件中

	区别:
		include
			引入失败会给一个警告性的错误,不影响后面代码的执行
		require
			引入失败会给一个致命性错误,后面代码将无法正常执行

		include_once 与 require_once
			用法与 include 和 require 是一样

	    区别：
	      同一个文件，用 include 和 require 可以多次引入 ，而使用 include_once 和 require_once 只能使用这两个方法中的其中一个方法引入一次，不能重复引入。

	     通常情况如果在文件开头需要引入文件时，会选择使用 require , 在文件编码过程中需要引入文件时，会使用 include。

		 引入完整页面，通常使用 require
		 引入代码片断，通常使用 include



*/
